Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.read.textFile("onsite_data.txt")
      .map(line => line.split("\t"))
      .map(arr => (arr(0), arr(1).toLong))
      .toJavaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").toJavaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Boolean)] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(record => {
      val query = record._1
      val timestamp = record._2

      // Check if query is in top queries
      if (broadcastTopQueries.value.contains(query)) {
        // Check if query is in cache
        if (cache.contains(query)) {
          // Check if query is still in cache
          if (timestamp - cache(query)._1 <= 12 * 60 * 60) {
            // Cache hit
            (query, true)
          } else {
            // Cache miss, update cache
            cache.put(query, (timestamp, true))
            (query, false)
          }
        } else {
          // Cache miss, update cache
          cache.put(query, (timestamp, true))
          (query, false)
        }
      } else {
        // Query not in top queries, ignore
        (query, false)
      }
    }).filter(_._2).count() / onsiteData.count().toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries into JavaRDDs. It then broadcasts the top frequent queries to all nodes in the cluster. It initializes a cache to store the queries and their timestamps. It then processes the onsite attributed data, checking if each query is in the top frequent queries and if it is in the cache. If it is in the cache and the timestamp is within 12 hours, it is a cache hit. If it is not in the cache or the timestamp is not within 12 hours, it is a cache miss and the cache is updated. The job then calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite attributed data.

